import styles from "./MyFooter.module.css"
import logo from "./../../assets/img/logo.svg"

const MyFooter = () => {
    return (
        <div className={styles.footer_main}>
            <div>
                <img src={logo} alt="" />
            </div>
        </div>
    )
}

export default MyFooter
